// src/pages/Home.js
import React from "react";
import { Link } from "react-router-dom";
import Section from "../components/UI/Section";
import { motion } from "framer-motion";

const Home = () => {
  const sections = [
    {
      center: true,
      content: (
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, ease: "easeOut" }}
          className="text-center px-6 py-20"
        >
          <h1 className="font-serif text-5xl md:text-6xl mb-4 text-gray-900">
             Taylor-maid <span className="font-cursive text-primary">Taylor</span> 
          </h1>
          <p className="text-lg md:text-xl text-neutral-600 max-w-2xl mx-auto">
            From registry to nursery ‚Äî every detail Taylor‚ÄëMade for you.
          </p>
          <Link to="/contact">
            <motion.button
              whileHover={{ scale: 1.03 }}
              whileTap={{ scale: 0.97 }}
              className="mt-8 px-6 py-3 rounded-lg bg-primary text-white font-medium transition-shadow shadow-lg hover:shadow-xl"
            >
              Book Your Consultation
            </motion.button>
          </Link>
        </motion.div>
      ),
    },
    {
      title: "Introduction",
      content: (
        <motion.div
          initial={{ opacity: 0, x: -20 }}
          whileInView={{ opacity: 1, x: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, ease: "easeOut" }}
          className="px-6 py-16 max-w-3xl mx-auto text-gray-700"
        >
          <p className="cc-lead font-serif text-xl">
            Preparing for a baby should feel exciting, not overwhelming. At{" "}
            <span className="font-serif font-bold">The Registry <span className="font-cursive">Taylor</span></span>, I guide you
            through every step of baby prep ‚Äî from registries and strollers to
            nursery design, showers, and family dynamics.
          </p>
          <p className="mt-6 text-lg leading-relaxed">
            With my <em>Taylor‚ÄëMade</em> approach, you‚Äôll feel supported,
            confident, and ready to welcome your little one with ease.
          </p>
        </motion.div>
      ),
    },
    {
      title: "Services Snapshot ‚Äî Taylor‚ÄëMade for You",
      content: (
        <motion.div
          initial={{ opacity: 0, x: 20 }}
          whileInView={{ opacity: 1, x: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, ease: "easeOut" }}
          className="px-6 py-16"
        >
          <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-3">
            {[
              {
                title: "Taylor‚ÄëMade Registry",
                desc: "Custom registries designed around your lifestyle and values.",
              },
              {
                title: "Taylor‚ÄëMade Gear",
                desc: "Honest advice on strollers, car seats, and baby gear.",
              },
              {
                title: "Taylor‚ÄëMade Nursery",
                desc: "From layout to d√©cor ‚Äî spaces that are safe, stylish, and functional.",
              },
              {
                title: "Taylor‚ÄëMade Showers",
                desc: "Planning made simple, from themes to thank‚Äëyous.",
              },
              {
                title: "Taylor‚ÄëMade Support",
                desc: "Yes, even in‚Äëlaw diplomacy ‚Äî I‚Äôll help keep everyone on the same page.",
              },
            ].map((service, i) => (
              <motion.div
                key={i}
                whileHover={{ scale: 1.02 }}
                className="p-6 border border-gray-300 rounded-xl shadow bg-white transition-shadow duration-300"
              >
                <h3 className="font-serif text-2xl mb-2 text-gray-900">
                  {service.title}
                </h3>
                <p className="text-gray-600">{service.desc}</p>
              </motion.div>
            ))}
          </div>
          <div className="mt-8 text-center">
            <Link to="/services">
              <motion.a
                whileHover={{ scale: 1.03 }}
                className="btn px-6 py-3 bg-primary text-white rounded-lg font-medium shadow-lg hover:shadow-xl transition-shadow"
              >
                Explore All Services ‚Üí
              </motion.a>
            </Link>
          </div>
        </motion.div>
      ),
    },
    {
      title: "How It Works",
      content: (
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, ease: "easeOut" }}
          className="px-6 py-16 max-w-3xl mx-auto text-gray-700"
        >
          <ol className="space-y-6 list-decimal list-inside text-lg">
            <li>
              <strong>Book Your Consultation</strong> ‚Äî Start with a quick call or
              virtual meeting.
            </li>
            <li>
              <strong>Share Your Vision</strong> ‚Äî Tell me your must‚Äëhaves,
              worries, and style.
            </li>
            <li>
              <strong>Get Your Plan</strong> ‚Äî Receive a personalized registry,
              gear guide, or nursery design plan.
            </li>
            <li>
              <strong>Enjoy the Journey</strong> ‚Äî With the details handled, you
              can focus on the moments that matter.
            </li>
          </ol>
        </motion.div>
      ),
    },
    {
      title: "Testimonials",
      center: true,
      content: (
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6, ease: "easeOut" }}
          className="px-6 py-16 max-w-2xl mx-auto space-y-6 text-gray-700"
        >
          <blockquote className="italic border-l-4 border-primary pl-4">
            ‚ÄúTaylor made our registry feel effortless ‚Äî no stress, no
            second‚Äëguessing.‚Äù ‚Äî Jenna M.
          </blockquote>
